import { React, useEffect, useState, useStyles } from 'react'
import { Box, Card, CardContent, Typography, Link } from '@material-ui/core/';
import { makeStyles } from '@material-ui/styles'
import './App.js'
import fs from 'fs';
import matter from 'gray-matter';







export async function getStaticProps(){
  const files = fs.readdirSync('posts_md');

  const posts = files.map((fileName) => {
    const slug = fileName.replace('.md', '');
    const readFile = fs.readFileSync(`posts/${fileName}`, 'utf8');
    const { data: frontmatter} = matter(readFile);
    return {
      slug,
      frontmatter
    }
  })

  return {
    props: {
      posts,
      files
    }
  }
}

function Post1({posts, files}) {
  return (
    <div>

      {console.log("hej " + posts +" " +files)}

      {posts?.map(({ slug, frontmatter}) => (
        <div>
          {frontmatter.title}
        </div>
            
      ))}

      {posts?.map(({ slug, frontmatter}) => (
        
        <div key={slug}>
          <Link href={`/post/${slug}`}>
            {frontmatter.title}
          </Link>
        </div> 
      ))}
    </div>
  )
}

export {Post1}
